/*  "/api/products"
 *  GET: finds all products
 */
app.get("/api/products",async function (req, res) {

    var value = await cache.get('image-cache');

    if(value == null){
        database.collection(PRODUCTS_COLLECTION).find({}).toArray(async function (error, data) {
            if (error) {
                manageError(res, err.message, "Failed to get contacts.");
            } else {
    
                value =  data ? JSON.stringify(data[Math.floor(Math.random() * data.length)]) : ''; //random image 
                await cache.set('image-cache', value);
            }
        });
    }

    console.log("<><><><><><><><><><>");
    console.log(value);

    return  res.status(200).json(value);
});


// Errors handler.
function manageError(res, reason, message, code) {
    console.log("Error: " + reason);
    res.status(code || 500).json({ "error": message });
}
